import React from "react";

function Image(props) {
  return (
    <section
      id="imageType"
      className={`image__wrap ${props.attr[0]} ${props.attr[1]}`}
    >
      <h2>
        {" "}
        이번주 판매 <em>베스트</em>
      </h2>
      <p>모두가 사랑하는 여행지, 지금 바로 즐기세요!</p>
      <div className={`image__inner ${props.attr[2]}`}>
        <article className="image">
          <img
            className="img img1"
            src="../img/image_bg01.jpg"
            no-repeat
            center
          />
          <div className="img text">
            <h3 className="image__title">sdfds</h3>
            <p className=".image__desc">sdfsds</p>
          </div>
        </article>
      </div>
    </section>
  );
}

export default Image;
